import React from 'react'
import TodoListItem from '.todo-list-item.js'
const TodoList = () => {
    const items = ['Learn React ', 'Build Awesome App'];
    return (
        <ul>
        <li><TodoListItem/></li>
        <li>{items[1]}</li>
        </ul>   
    );
    }
export default TodoList;
